import React from 'react'
import { Link } from 'react-router-dom';

const Register = () => {
  const [credntials, setCredentials] = React.useState({
    email: '',
    password: '',
    confirmPassword: ''
  })

  const handleChange = (e) => {
    setCredentials({
    ...credntials,
      [e.target.name]: e.target.value
    })
  }

  const handleSubmit = (e) => {
    e.preventDefault()
  }
 
  return (
    <form onSubmit={handleSubmit}>
    <h3>Create a patient account</h3>
    <div class="form-group">
        <label for="emailInput" class="form-label mt-4">Email address</label>
        <input 
          type="email" 
          class="form-control" 
          id="emailInput"  
          name="email"
          value={credntials.email}
          onChange={handleChange}
          placeholder="Enter email" 
          required
        />
    </div>
    <div class="form-group">
        <label for="passwordInput" class="form-label mt-4">Password</label>
        <input 
          type="password" 
          class="form-control" 
          id="passwordInput" 
          name="password"
          value={credntials.password}
          onChange={handleChange}
          placeholder="Enter password"  
          required
        />
    </div>
    <div class="form-group">
        <label for="confirmPassword" class="form-label mt-4">Confirm password</label>
        <input 
          type="password" 
          class="form-control" 
          id="confirmPassword" 
          name="confirmPassword"
          value={credntials.confirmPassword}
          onChange={handleChange}
          placeholder="Confirm password"  
          required
        />
    </div>
    <input type="submit" value="Login" className="btn btn-primary my-3"/>
    <p>Already have an account? <Link to="/login">Log in</Link></p>
</form>
  )
}

export default Register;
